import { UIContainer } from './styles/StyledInfoContainer'

import InfoContainer from './components/InfoContainer';
import ProjectsContainer from './components/ProjectsContainer';
import { AppContainer } from './styles/AppContainer';

export default function App() {

  return (
		<AppContainer id='AppContainer'>
			<UIContainer id='StyledUIContainer'>
      <InfoContainer>
        <Avatar id='StyledAvatar' src={require('../assets/avatar.png')}/>
          <CurrentTime id='StyledCurrentTime'>
            <Time id='Time'>{currentTime}</Time>
            <PMAM id='PMAM'> {pmAm}</PMAM>
          </CurrentTime>
          <StyledFaReact id='StyledFaReact'/>
          <BatteryLife id='StyledBatteryLife'>
            <BatteryLifeOuter id='BatteryLifeOuter'/>
            <BatteryLifeInner id='BatterLifeInner'/>
            <BatteryLifeTerminal id='BatterLifeTerminal'/>
          </BatteryLife> 
        </InfoContainer>
				<ProjectsContainer/>
			</UIContainer>
		</AppContainer>
  );
}
